import React from "react";
import { connect } from "react-redux";
import { newGame, reset } from "../actions";
import "./Buttons.css";

const ButtonSet = props => {
  return (
    <button className="btn btn-set" onClick={props.onClick}>
      {props.btnName}
    </button>
  );
};

export default connect(
  null,
  { newGame }
)(ButtonSet);
